			LHS[IDX2C(i, x, 3 * (num_nodes))] = (dt*dt)*K_in[IDX2C(i, x, 3 * (num_nodes))];
			}*/

		}
		a = a*dt;
		b = b*dt;


		RHS[x] = a - b + c;
